Вот обновленный код, который включает в себя логику группировки пикетов и определения границ поперечников:

```python
import ezdxf
import tkinter as tk
from tkinter import filedialog
import re

def select_file():
    """Функция для выбора DXF файла."""
    root = tk.Tk()
    root.withdraw()  # Скрыть главное окно
    file_path = filedialog.askopenfilename(title="Выберите файл DXF", filetypes=[("DXF files", "*.dxf")])
    return file_path

def write_entities_to_txt(dxf_file_path, output_file_path):
    """Функция для записи сущностей из DXF файла в текстовый файл."""
    doc = ezdxf.readfile(dxf_file_path)

    # Открытие файла с указанием кодировки UTF-8
    with open(output_file_path, 'w', encoding='utf-8') as output_file:
        for layer in doc.layers:
            output_file.write(f"Слой: {layer.dxf.name}\n")
            polyline_count = 1  # Счетчик для полилиний
            last_y = None  # Переменная для хранения последней Y координаты

            # Группировка пикетов
            pit_labels = {}
            for entity in doc.modelspace().query('*[layer=="{}"]'.format(layer.dxf.name)):
                if entity.dxftype() == 'TEXT':
                    text_content = entity.dxf.text.strip()
                    if re.match(r'^[0-9]+[+]?[0-9.]+[PCK]?', text_content):
                        pit_labels[text_content] = entity.dxf.insert

            # Определение границ поперечников
            pit_boundaries = {}
            for pit, insert in pit_labels.items():
                if pit not in pit_boundaries:
                    pit_boundaries[pit] = {'horizontal': [], 'vertical': []}

                # Найти ближайшую горизонтальную линию
                min_horizontal_distance = float('inf')
                min_horizontal_point = None
                min_vertical_distance = float('inf')
                min_vertical_point = None

                for entity in doc.modelspace().query('*[layer=="{}"]'.format(layer.dxf.name)):
                    if entity.dxftype() == 'LINE' or entity.dxftype() == 'LWPOLYLINE':
                        start_point = entity.dxf.start if entity.dxftype() == 'LINE' else entity.vertices()[0]
                        end_point = entity.dxf.end if entity.dxftype() == 'LINE' else entity.vertices()[-1]

                        horizontal_distance = abs(start_point[1] - insert[1])
                        vertical_distance = abs(start_point[0] - insert[0])

                        if horizontal_distance < min_horizontal_distance:
                            min_horizontal_distance = horizontal_distance
                            min_horizontal_point = start_point

                        if vertical_distance < min_vertical_distance:
                            min_vertical_distance = vertical_distance
                            min_vertical_point = start_point

                if min_horizontal_point and min_horizontal_distance < min_vertical_distance:
                    pit_boundaries[pit]['horizontal'].append(min_horizontal_point)
                else:
                    pit_boundaries[pit]['vertical'].append(min_vertical_point)

            # Запись результатов в файл
            for pit, boundaries in pit_boundaries.items():
                for boundary_type, points in boundaries.items():
                    if points:
                        points_str = '\n  '.join(f"({point[0]}, {point[1]})" for point in points)
                        output_file.write(f"Пикет {pit} {boundary_type}: {points_str}\n")

        # Запись остальных сущностей
        for entity in doc.modelspace().query('*[layer=="{}"]'.format(layer.dxf.name)):
            if entity.dxftype() != 'TEXT':
                output_file.write(f"{entity.dxftype()} {entity.dxf.text} "
                                  f"({entity.dxf.insert.x}, {entity.dxf.insert.y})\n")

def main():
    dxf_file_path = select_file()
    if dxf_file_path:
        output_file_path = dxf_file_path.replace('.dxf', '.txt')
        write_entities_to_txt(dxf_file_path, output_file_path)
        print(f"Данные успешно записаны в файл: {output_file_path}")
    else:
        print("Файл не выбран.")

if __name__ == "__main__":
    main()
```

Этот код включает следующие изменения:

1. **Группировка пикетов**: Мы используем регулярное выражение для поиска текстов, которые соответствуют формату пикета. Эти тексты сохраняются с их координатами.

2. **Определение границ поперечников**: Для каждого найденного пикета мы ищем ближайшую горизонтальную или вертикальную линию. Если линия горизонтальна, мы добавляем её координаты в соответствующий список.

3. **Запись результатов в файл**: Мы записываем найденные пикеты и их границы в текстовый файл.

