       ret = mtk_nand_data(nand);
       if (ret)
           goto err;

       ret = mtk_nand_release_chip(nand);
       if (ret)
           goto err;

       return ret;

err:
       mtk_nand_release_chip(nand);
       return ret;
   }
   ```

